import React from "react";
import "./Timeline.css";
import timelineImage from "./timelines.png"; // import the image
import { useEffect } from "react";

function Timeline() {
  useEffect(() => {
    const handleScroll = () => {
      const hiddenStages = document.querySelectorAll(".hidden-stage");
      hiddenStages.forEach((stage) => {
        const rect = stage.getBoundingClientRect();
        if (rect.top <= window.innerHeight) {
          stage.style.visibility = "visible";
          stage.style.opacity = 1;
        }
      });
    };

    window.addEventListener("scroll", handleScroll);

    // Cleanup the event listener
    return () => window.removeEventListener("scroll", handleScroll);
  }, []);

  return (
    <div className="Timelinecontainer">
      <div className="LeftHalf">
        <div className="TimelineHeading">TIMELINE</div>
      </div>
      <div className="RightHalf">
        <div className="timeline">
          <div className="relative">
            <div className="dot"></div>
            <div className="pl-10">
              <span className="timeline-date" style={{ color: "#fff" }}>
                4 March 2024
              </span>
              <h3 className="timeline-title">Registartion Opens</h3>
            </div>
          </div>
          <div className="relative">
            <div className="dot"></div>
            <div className="pl-10">
              <span className="timeline-date" style={{ color: "#fff" }}>
                4 March 2024
              </span>
              <h3 className="timeline-title">Registartion Opens</h3>
            </div>
          </div>
          <div className="relative">
            <div className="dot"></div>
            <div className="pl-10">
              <span className="timeline-date" style={{ color: "#fff" }}>
                4 March 2024
              </span>
              <h3 className="timeline-title">Registartion Opens</h3>
            </div>
          </div>
          <div className="relative hidden-stage">
            <div className="dot"></div>
            <div className="pl-10">
              <span className="timeline-date" style={{ color: "#fff" }}>
                4 March 2024
              </span>
              <h3 className="timeline-title">Registration Opens</h3>
            </div>
          </div>
          <div className="relative hidden-stage">
            <div className="dot"></div>
            <div className="pl-10">
              <span className="timeline-date" style={{ color: "#fff" }}>
                4 March 2024
              </span>
              <h3 className="timeline-title">Registration Opens</h3>
            </div>
          </div>
          <div className="relative hidden-stage">
            <div className="dot"></div>
            <div className="pl-10">
              <span className="timeline-date" style={{ color: "#fff" }}>
                4 March 2024
              </span>
              <h3 className="timeline-title">Registration Opens</h3>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
}

export default Timeline;
